import React, { Component } from 'react';
import logo from './info.png';
import './App.css';
import Member from './Member';

class App extends Component {
  state = {
    information: [
      {
        id:0,
        number:'DSM2016',
        name: '이재석'
      }
    ]
  }
  render() {
    return (
      <div className="App">
        <div className="App-navbar">
          <img src={logo} className="App-logo"/>
          <div className="menu">
            <ul>
              <li>메인</li>
              <li>커리큘럼</li>
              <li>과제제출</li>
              <li>로그인</li>
            </ul>
          </div>
        </div>
        <div className="Introduce">
          <img src={logo} className="Logo"/>
          <div className="Introduce-club">
            <h2 className="Introduce-title">동아리 소개</h2>
            <p>INFO 동아리는 대덕소프트웨어마이스터고등학교에서 정보보안에 관심있는 학생들의 Long run을 위한 기반지식 습득 가이드라인을 제작하는 동아리입니다.</p>
          </div>
          <div className="Introduce-member">
            <h2 className="Introduce-title">동아리원 소개</h2>
            <h3 className="Introduce-title">운영진</h3>
            <p>DSM2016 이재석</p>
            <p>30414 이지후</p>
            <h3 className="Introduce-title">멤버</h3>
            <p>DSM2016 이재빈</p>
            <p>30401 강민범</p>
            <p>30405 박보현</p>
            <p>20401 김경민</p>
            <Member />
          </div>
          <div className="Introduce-history">
            <h2 className="Introduce-title">동아리 활동</h2>
            <p>2017년 동아리 설립</p>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
